import React from 'react';
import { Box, Typography, Avatar } from '@mui/material';

const getInitial = (text) => (text && text.length > 0 ? text[0].toUpperCase() : 'A');

// ProfileDisplay-Komponente: Zeigt die wichtigsten Profildaten eines Kandidaten an
const ProfileDisplay = ({ profile }) => {
  // Falls kein Profil Ã¼bergeben wurde, nichts anzeigen
  if (!profile) return null;

  return (
    <Box sx={{ bgcolor: '#fff', borderRadius: '18px', p: { xs: 2, sm: 4 }, boxShadow: '0 1px 6px rgba(0,0,0,0.07)', mb: 4 }}>
      {/* Kopfbereich mit Bild und Basisinfos */}
      <Box className="profile-header" sx={{ display: 'flex', alignItems: 'center', gap: '24px', mb: '36px' }}>
        {/* Profilbild, falls vorhanden */}
        {profile.imageUrl && (
          <Box component="img" src={profile.imageUrl} alt="Profilbild" sx={{ width: '100px', height: '100px', borderRadius: '50%', objectFit: 'cover', boxShadow: '0 2px 8px rgba(0,0,0,0.08)' }} />
        )}
        {/* Name, aktuelle Position und Standort */}
        <Box className="profile-info">
          <Typography variant="h2" sx={{ fontSize: '1.5rem', fontWeight: 700, color: '#1a1a1a', m: 0, mb: 0.5 }}>{profile.name || 'No name available'}</Typography>
          <Typography sx={{ fontSize: '1.05rem', color: '#222', mb: 1 }}>{profile.currentTitle || 'No position given'}</Typography>
          <Typography sx={{ fontSize: '1.05rem', color: '#444' }}>{profile.location || 'No location given'}</Typography>
        </Box>
      </Box>

      {/* Berufserfahrung und Ausbildung nebeneinander */}
      <Box sx={{ display: 'grid', gridTemplateColumns: { xs: '1fr', md: '1fr 1fr' }, gap: 5, mb: 4 }}>
        {/* Berufserfahrung */}
        <Box>
          <Typography variant="h3" sx={{ fontSize: '1.25rem', fontWeight: 800, color: '#1a1a1a', mb: 2.5, pb: 1, borderBottom: '2px solid #e0e0e0' }}>Experience</Typography>
          {profile.experience && profile.experience.length > 0 ? (
            profile.experience.map((exp, index) => (
              <Box key={index} sx={{ 
                py: 2.2, 
                borderBottom: index < profile.experience.length - 1 ? '1px solid #e0e0e0' : 'none',
                display: 'flex',
                gap: 2.5,
                alignItems: 'flex-start',
                position: 'relative',
                '&::after': index < profile.experience.length - 1 ? {
                  content: '""',
                  position: 'absolute',
                  left: '22px',
                  top: '56px',
                  bottom: '-16px',
                  width: '2px',
                  backgroundColor: '#e0e0e0'
                } : {}
              }}>
                <Avatar sx={{ bgcolor: '#222', color: '#fff', width: 44, height: 44, fontWeight: 700, fontSize: '1.25rem', boxShadow: '0 2px 8px rgba(0,0,0,0.08)' }}>
                  {getInitial(exp.title)}
                </Avatar>
                <Box>
                  <Typography sx={{ fontSize: '1.08rem', fontWeight: 700, color: '#1a1a1a', mb: 0.3 }}>{exp.title || 'No position given'}</Typography> 
                  <Typography sx={{ fontSize: '1rem', color: '#222', mb: 0.3 }}>{exp.company || 'No company given'}</Typography>
                  <Typography sx={{ fontSize: '0.95rem', color: '#888', opacity: 0.95 }}>{exp.duration || 'No duration given'}</Typography>
                </Box>
              </Box>
            ))
          ) : (
            <Typography sx={{ color: '#aaa', fontSize: '1.05rem' }}>No experience given</Typography>
          )}
        </Box>
        {/* Ausbildung */}
        <Box>
          <Typography variant="h3" sx={{ fontSize: '1.25rem', fontWeight: 800, color: '#1a1a1a', mb: 2.5, pb: 1, borderBottom: '2px solid #e0e0e0' }}>Education</Typography>
          {profile.education && profile.education.length > 0 ? (
            profile.education.map((edu, idx) => (
              <Box key={idx} sx={{ 
                py: 2.2, 
                borderBottom: idx < profile.education.length - 1 ? '1px solid #e0e0e0' : 'none',
                display: 'flex',
                gap: 2.5,
                alignItems: 'flex-start',
                position: 'relative',
                '&::after': idx < profile.education.length - 1 ? {
                  content: '""',
                  position: 'absolute',
                  left: '22px',
                  top: '56px',
                  bottom: '-16px',
                  width: '2px',
                  backgroundColor: '#e0e0e0'
                } : {}
              }}>
                <Avatar sx={{ bgcolor: '#222', color: '#fff', width: 44, height: 44, fontWeight: 700, fontSize: '1.25rem', boxShadow: '0 2px 8px rgba(0,0,0,0.08)' }}>
                  {getInitial(edu.degree)}
                </Avatar>
                <Box>
                  <Typography sx={{ fontSize: '1.08rem', fontWeight: 700, color: '#1a1a1a', mb: 0.3 }}>{edu.degree || 'No degree given'}</Typography>
                  <Typography sx={{ fontSize: '1rem', color: '#222', mb: 0.3 }}>{edu.school || 'No school/university given'}</Typography>
                  <Typography sx={{ fontSize: '0.95rem', color: '#888', opacity: 0.95 }}>{edu.startDate || ''}{(edu.startDate && edu.endDate) ? ' - ' : ''}{edu.endDate || ''}</Typography>
                </Box>
              </Box>
            ))
          ) : (
            <Typography sx={{ color: '#aaa', fontSize: '1.05rem' }}>No education given</Typography>
          )}
        </Box>
      </Box>

      {/* Zusammenfassung, falls vorhanden */}
      {profile.summary && (
        <Box sx={{ mb: 4 }}>
          <Typography variant="h3" sx={{ fontSize: '1.15rem', fontWeight: 700, color: '#1a1a1a', mb: 2, pb: 1, borderBottom: '2px solid #e0e0e0' }}>Summary</Typography>
          <Typography sx={{ color: '#444', lineHeight: 1.6, whiteSpace: 'pre-line', fontSize: '1.05rem' }}>{profile.summary}</Typography>
        </Box>
      )}
    </Box>
  );
};

export default ProfileDisplay;
